import React from 'react';
import { connect } from 'redux-bundler-react';
import AoiListItem from './aoi-list-item'

class AoiList extends React.Component{
    render(){
        const {drawDataFeatures} = this.props;
        if(!drawDataFeatures) return null;
        return (
            
            <ul className="list-group">
                {
                    drawDataFeatures.map((feature, i) =>{
                        return(
                            <AoiListItem
                                key={i}
                                geometry = {feature}
                            />
                        )
                    })
                }
            </ul>
        )
    }
}

export default connect(
    'selectDrawDataFeatures',
    AoiList
)
